const rockTypes = [
    [{ x: 0, y: 0 }, { x: 1, y: 0 }, { x: 2, y: 0 }, { x: 3, y: 0 }],
    [{ x: 1, y: 0 }, { x: 0, y: -1 }, { x: 1, y: -1 }, { x: 2, y: -1 }, { x: 1, y: -2 }],
    [{ x: 2, y: 0 }, { x: 2, y: -1 }, { x: 2, y: -2 }, { x: 0, y: -2 }, { x: 1, y: -2 }],
    [{ x: 0, y: 0 }, { x: 0, y: -1 }, { x: 0, y: -2 }, { x: 0, y: -3 }],
    [{ x: 0, y: 0 }, { x: 1, y: 0 }, { x: 0, y: -1 }, { x: 1, y: -1 }]
];

const grid = [...Array(7)].reduce((acc, _, i) => { acc[i] = { 0: true }; return acc; }, { });
const maxGrid =  [...Array(7)].reduce((acc, _, i) => { acc[i] = 0; return acc; }, {});

const movementList = input.split('');
let movementIndex = 0;
let currentLeftX = 2;
let currentTopY = 3;
let rock = rockTypes[0];

let afterXRocks = [];
let maxRepeatSize = 0;
let minDiff = 999999999;
let searchStringMaxSize = '';
const rockCount = 1000000000000;
let invalidSearchList = {};
for (let rockIndex = 0; rockIndex < rockCount; rockIndex++) {
    const rockType = rockIndex % 5;
    rock = rockTypes[rockType];
    currentLeftX = 2;

    const bottomEdge = Math.min(...rock.map(r => r.y));
    let originalCurrentTopY = Math.max(...Object.values(maxGrid));
    currentTopY = originalCurrentTopY + 3 - bottomEdge + 1
    let maxTopGrid;
    while (true) {
        const nextMovement = movementList[movementIndex++ % movementList.length];
        potentialNextX = currentLeftX + (nextMovement === '<' ? - 1 : + 1);

        const rightOffset = Math.max(...rock.map(r => r.x));
        if (potentialNextX >= 0 && rightOffset + potentialNextX <= 6 && rock.every(pos => !grid[pos.x + potentialNextX] || !grid[pos.x + potentialNextX][pos.y + currentTopY])) {
            currentLeftX = potentialNextX;
        }

        // Freeze the rock an dselect the next rock
        if (rock.some(pos => grid[pos.x + currentLeftX]?.[pos.y + currentTopY - 1])) {
            rock.forEach(rockPos => {
                grid[currentLeftX + rockPos.x][currentTopY + rockPos.y] = true;
                maxGrid[currentLeftX + rockPos.x] = Math.max(maxGrid[currentLeftX + rockPos.x], currentTopY + rockPos.y);
            });
            break;
        }

        // otherwise move the rock down one
        currentTopY--;
    }

    const newMaxHeight = Math.max(...Object.values(maxGrid));
    const iterationValue = { rockType, height: newMaxHeight, heightDiff: newMaxHeight - originalCurrentTopY };
    afterXRocks.push(iterationValue);


    let newMax = 0;
    let maxSearch = '';
    if (afterXRocks.length % 10000 === 0) {
      for (let length = 1; length <= afterXRocks.length / 2; length++) {
          const search = afterXRocks.slice(-1 * length).map(r => `${r.rockType}-${r.heightDiff}`).join(';');
          if (invalidSearchList[search]) {
            continue;
          }
          let text = afterXRocks.map(r => `${r.rockType}-${r.heightDiff}`).join(';');

          const firstFind = text.slice(1, -1 * search.length).search(search);
          if (firstFind === -1) {
              invalidSearchList[search] = true;
              continue;
          }

          if (text.slice(firstFind + 1, firstFind + 1 + search.length + search.length + 1) !== `${search};${search}`) {
              continue;
          }

          if (search.length && maxSearch.length && search.length > maxSearch.length && maxSearch.length * 2 + 1 === search.length) {
            break;
          }

          if (search.length > maxSearch.length ) {
            maxSearch = search;
          }
      }
    }

    if (afterXRocks.length % 1000 === 0) {
      console.log(afterXRocks.length);
    }

    if (maxSearch.length) {
      const text = afterXRocks.map(r => `${r.rockType}-${r.heightDiff}`).join(';');
      const search = maxSearch;
      const initialPosition = text.search(search);
      const initialRocks = text.slice(0, initialPosition).split(';').map(t => t.trim()).filter(a => a).map(a => Number(a.split('-')[1]));
      remainingRocks = rockCount - initialRocks.length;
      const initalRockHeight = initialRocks.reduce((acc, r) => acc + r, 0);

      const repeatRocks = search.split(';').map(t => t.trim()).filter(a => a).map(a => Number(a.split('-')[1]));
      const repeatHeight = repeatRocks.reduce((acc, r) => acc + r, 0);

      const rocksAtEndLength = remainingRocks % repeatRocks.length;
      const rocksAtEnd = repeatRocks.slice(0, rocksAtEndLength);
      const endHeight = rocksAtEnd.reduce((acc, r) => acc + r, 0);

      const repeatRockCount = Math.floor(remainingRocks / repeatRocks.length);
      console.log(initalRockHeight + repeatRockCount * repeatHeight + endHeight);
      process.exit(0);
    }
    minDiff = maxSearch.length - maxRepeatSize;

    maxRepeatSize = Math.max(maxRepeatSize, maxSearch.length);
}

